function: "Don't you hate it when your table wobbles back and forth?  You shove napkins under the feet, or a newspaper or whatever and it never works right.  Now you can solve that problem.\r\n\r\nDownload and print this nifty keychain that allows you to quickly and easily remove the wedge from your key ring, fix the wobbly table and be on your way to stability! :)\r\n\r\nThe  key feature is the quick snap, attach / remove clip so that you can quickly remove the wedge from your keys and fix the table (see the photo)."
